import React from 'react';
import PropTypes from 'prop-types';
import Paper from '@material-ui/core/Paper';
import { withStyles } from '@material-ui/core/styles';

const styles = () => ({
    paper: {
        maxWidth: 936,
        margin: 'auto',
        overflow: 'hidden',
    }
});

function Content(props) {
    const { classes } = props;

    return (
        <Paper className={classes.paper}>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ab aperiam laborum rem. A aspernatur atque, ducimus eos, esse ex labore libero maxime molestiae molestias nam porro quo veniam? Autem dolores, earum enim exercitationem, harum iure labore libero molestiae nesciunt optio porro, qui quos repellendus saepe sunt temporibus totam vero voluptatem. A aliquam architecto aspernatur at cumque dolores dolorum ea error eveniet facere fugiat id itaque iure laboriosam modi nemo non, numquam officia omnis optio perspiciatis quae quam, quas quod ratione soluta suscipit! A asperiores atque dicta, esse et hic id illum impedit modi molestias nulla quibusdam repellat sit vitae voluptatem.
        </Paper>
    );
}

Content.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Content);
